import React, { Component } from "react";
import About from "./components/About/About";
export default class App extends Component {
  state = {
    userName: "mahmoud",
    lastName: "kadry",
    job:'idk',
    age:'26'
  };
  render() {
    return (
      <>
        h2 {this.state.userName}
        {this.state.lastName}
        <About />
      </>
    );
  }
}
